"use strict";

function initBounceRate() {
  new ApexCharts(document.querySelector("#bounce-rate"), {
    chart: {
      type: "area",
      height: 60,
      sparkline: {
        enabled: !0
      }
    },
    series: [{
      name: "Bounce Rate (Avg)",
      data: [25, 60, 20, 90, 45, 100, 45, 100, 55]
    }],
    stroke: {
      width: 1,
      curve: "smooth"
    },
    fill: {
      opacity: [.85, .25, 1, 1],
      gradient: {
        inverseColors: !1,
        shade: "light",
        type: "vertical",
        opacityFrom: .5,
        opacityTo: .1,
        stops: [0, 65, 100]
      }
    },
    yaxis: {
      min: 0
    },
    colors: ["#25b865"],
    tooltip: {
      theme: "dark",
      y: {
        formatter: function formatter(e) {
          return +e + "K";
        }
      }
    }
  }).render();
}
